import { Routes, Route, NavLink } from "react-router-dom";
import Home from "../"
export default function NavBar() {

  return (
    <nav>
        
      <NavLink to="/" >Home</NavLink>
      <NavLink to="/products" >Products</NavLink>
    
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
    </nav>
  )
}
